import React from 'react';
import {History} from './components/History/History.js';
import './css/App.css';
import {NavBar} from './components/Nav.js';
import {Intro, Descriptions} from './components/Home.js';
import Prevention from './components/History/Prevention';
import {Prediction} from './components/History/Prediction';
import About from './About';

function App() {
  return (
    <div>
      <NavBar/>
      <Intro/>
      <Descriptions/>
      <History/>
      <Prediction/>
      <Prevention />
      <About />
    </div>
  )
}

export default App;
